const SWAPI_ROOT = 'https://swapi.dev/api/';
const SWAPI_PEOPLE = 'people';

const getApiResource = () => {
    const data = fetch(SWAPI_ROOT+SWAPI_PEOPLE)
    .then(res => {
        return res.json()
        console.log()
    })
    .then(res => console.log(res))
    .catch(error => console.log(error));

    console.log('getApiResource');
    console.log(data);
}

getApiResource();
export {getApiResource};
